  // ключевые координаты
  private getCoordKey(secretName, coord: CoordsModel) {
    var result = [];
    result.push({ title: coord.matrix.name, src: "/ngenix/coord/matrix/" + coord.matrix.filename });
    if (secretName) {
      var playlist = this.getSecretNamePlaylist(secretName);
      for (var i in playlist) {
        result.push(playlist[i]);
      };
    };
    return result;
  };

